function concertsAjaxCall(){$.ajax({method:"GET",url:baseurl+"/concerts/artist/"+$(".artist-details").data("name")}).done(function(data){200==data.status&&loadArtistConcert(data.data)})}function loadArtistConcert(data){for(var html="",i=0;5>i;i++){var concertDetails=data[i],html=html+'<div class="concert" data-id="'+concertDetails.id+'">';null!=concertDetails.image?html=html+'<img class="lazy" data-original="'+concertDetails.image.url+'" width="42" height="42">':html+='<img class="lazy" data-original="" width="42" height="42">',html=html+concertDetails.title+", "+concertDetails.city+", "+concertDetails.country+"<br>Datum: "+concertDetails.start_time.date+"</div>"}$(".concerts").html(html),$("img.lazy").lazyload(),$("body").on("click",".concert",function(){window.location.href=baseurl+"/concert/"+$(this).data("id")})}$(function(){concertsAjaxCall()});